package com.hr.ui.model;

public class AboutEducation {
    private String start_time = "";//开始时间
    private String end_time = "";//结束时间
    private String school = "";//院校
    private String education = "";//学历
    private String major = "";//专业
    private String Study_Abroad = "";//海外学习
    private String Professional_description = "";//专业描述

    public AboutEducation() {
        // TODO Auto-generated constructor stub
    }

    public String getStart_time() {
        return start_time;
    }

    public void setStart_time(String start_time) {
        this.start_time = start_time;
    }

    public String getEnd_time() {
        return end_time;
    }

    public void setEnd_time(String end_time) {
        this.end_time = end_time;
    }

    public String getSchool() {
        return school;
    }

    public void setSchool(String school) {
        this.school = school;
    }

    public String getEducation() {
        return education;
    }

    public void setEducation(String education) {
        this.education = education;
    }

    public String getMajor() {
        return major;
    }

    public void setMajor(String major) {
        this.major = major;
    }

    public String getStudy_Abroad() {
        return Study_Abroad;
    }

    public void setStudy_Abroad(String study_Abroad) {
        Study_Abroad = study_Abroad;
    }

    public String getProfessional_description() {
        return Professional_description;
    }

    public void setProfessional_description(String professional_description) {
        Professional_description = professional_description;
    }


}
